INSERT INTO `wp_options` VALUES (283,'elementor_remote_info_feed_data','a:3:{i:0;a:5:{s:5:\"title\";s:126:\"New in Elementor 3.25: CSS Optimization, New Anchor Offset Control & Pagination Options for Live Results in the Search widget!\";s:7:\"excerpt\";s:183:\"Boost your site’s speed with further CSS optimization, enjoy smooth scrolling with native CSS and Anchor Offset, and enhance search functionality with pagination for Live Results!\r\n\";s:7:\"created\";i:1730630544;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:157:\"https://elementor.com/blog/elementor-325-css-loading-anchor-offset-search-pagination/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:81:\"Introducing Site Mailer by Elementor: Improve Your WordPress Email Deliverability\";s:7:\"excerpt\";s:377:\"In the world of WordPress, managing transactional emails can be a real challenge. From emails landing in spam folders to issues with server configurations, ensuring your messages are delivered can feel overwhelming.\r\nEnter Site Mailer by Elementor—a powerful plugin designed to solve your email deliverability issues with ease, eliminating the need for complex SMTP setups.\r\n\";s:7:\"created\";i:1727247060;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:123:\"https://elementor.com/blog/introducing-site-mailer/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:87:\"Introducing Elementor 3.24: Floating Bars, Variable Fonts, Enhanced CSS Loading & More!\";s:7:\"excerpt\";s:116:\"Elevate Your Websites with Floating Bars and Variable Fonts, Improve Performance with Enhanced CSS Loading and More!\";s:7:\"created\";i:1725891168;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:155:\"https://elementor.com/blog/elementor-324-floating-bars-variable-fonts-enhanced-css/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}','off');
