INSERT INTO `wp_posts` VALUES (380,2,'2024-09-30 09:41:35','2024-09-30 09:41:35','<h2>Article 1 : Mentions légales.</h2>\nL’édition du Site est assurée par la société SARL PLUS UN MUSIC SERVICES au capital de 1 000 €, inscrite au RCS sous le numéro 830848883, dont le siège social est localisé au 23-25 rue Ledion, 75014 Paris. Tél : +33 7 66 70 56 81, Email : contact@plusunmusic.com\nL’hébergeur du Site est la société Hostinger International Ltd, société privée à responsabilité limitée de Chypre, dont le siège social est situé au 61 Lordou Vironos str. 6023 Larnaca, Chypre. Contact : https://www.hostinger.fr/contact\nDirecteur de la publication : Monsieur Groussin Emilien, Président de la SARL PLUS UN MUSIC SERVICES.\n\n&nbsp;\n<h2>Article 2 : Accès au Site.</h2>\nLes présentes conditions encadrent l’utilisation du site de la société Plus Un Music Services (ci-après dénommé « le Site ») par les personnes naviguant sur le Site (les « Internautes » ou « vous » ). En naviguant sur le Site, vous reconnaissez avoir pris connaissance et acceptez pleinement et sans réserve ces conditions qui peuvent être modifiées à tout moment.\nLe Site permet aux Internautes disposant d’une connexion internet de naviguer et de consulter la liste des différents services proposés par Plus Un Music Services.\n<h2></h2>\n<h2>Article 3 : Collecte des données.</h2>\nLors de la navigation sur le Site, seuls des cookies de données techniques (logs) nécessaires à l’accès au Site ou à la traçabilité ou des cookies de mesure d’audience ou des cookies réseaux sociaux (avec votre consentement) peuvent être déposés. Les cookies correspondent à de petits fichiers déposés temporairement sur le disque dur de votre terminal. Si vous y consentez via le bandeau Cookie, le Groupe Meta (comprenant Facebook, Instagram et WhatsApp), LinkedIn, X (ex-twitter), TikTok, et Google Analytics déposeront des traceurs sur votre terminal et accèderont à certaines de vos données pour vous permettre de partager du contenu directement sur vos comptes de réseaux sociaux ou pour mesurer l’audience du Site et suivre le trafic ; conformément à leurs Politiques de confidentialité et l’information donnée au sein du bandeau cookies. Ils ne sont utilisés qu\'à des fins statistiques et ne permettent pas de vous identifier personnellement. Les cookies sont stockés sur votre navigateur pour une durée maximale de 14 mois. Passé ce délai, les données collectées seront supprimées automatiquement. Vous pouvez à tout moment revenir sur vos choix conformément aux paramètres de votre navigateur ou en utilisant le module de désactivation de Google Analytics.\n\nLorsque vous contactez Plus Un Music Services via le formulaire de contact, les données (champs obligatoires) transmises sont nécessaires au traitement de la demande et les données facultatives permettent d’affiner la réponse de la société, ce à quoi vous consentez expressément en envoyant le formulaire de contact. Les données relatives à ce formulaire ainsi que les réponses apportées sont conservées pendant 2 ans à compter du dernier contact. Ces données sont transmises aux services compétents de Plus Un Music Services. Conformément à la réglementation en vigueur en France, vous bénéficiez d’un droit d’accès, de limitation, de portabilité et de rectification aux informations qui vous concernent. L’exercice de ce droit s’effectue grâce au formulaire de contact. En cas de réponse insatisfaisante, vous pouvez introduire une réclamation auprès de la Commission Nationale de l’Informatique et des Libertés (CNIL).\n<h2></h2>\n<h2>Article 5 : Propriété intellectuelle.</h2>\nPlus Un Music Services détient seul les droits de propriété intellectuelle afférents au Site, qui demeure sa propriété exclusive. L’Internaute s\'interdit donc d’utiliser, de reproduire, directement ou indirectement, en totalité ou en partie, d\'adapter, de modifier, de traduire, de représenter, de commercialiser ou de diffuser à toute personne, tout ou partie du Site, sans l\'autorisation expresse et écrite de Plus Un Music Services.\n<h2></h2>\n<h2>Article 6 : Responsabilité.</h2>\nPlus Un Music Services veille au bon fonctionnement du Site et à la mise à jour des contenus du Site, cependant, elle ne pourra être tenu responsable de tout dommage, qu’il soit direct ou indirect, résultant de l’interruption d’accès au Site, de l’utilisation du Site ou résultant de toute erreur ou omission dans le contenu du Site.\n<h2></h2>\n<h2>Article 7 : Liens hypertextes.</h2>\nLe Site peut contenir des liens hypertextes pointant vers des sites tiers sur lesquels Plus Un Music Services n’exerce aucun contrôle. Malgré les vérifications préalables réalisées, Plus Un Music Services ne pourra être tenue responsable quant aux contenus pointés. L’autorisation préalable de Plus Un Music Services est nécessaire avant toute insertion d’un lien hypertexte pointant vers le Site ; faute de quoi, Plus Un Music Services pourra demander la suppression dudit lien hypertexte.\n<h2></h2>\n<h2>Article 8 : Droit applicable et juridiction compétente.</h2>\nLes présentes conditions sont soumises à la loi française. Le tribunal compétent en cas de litige sera celui du lieu de domicile du défendeur.','MENTION LÉGALES & CGU','','publish','closed','open','','mentions-legales-cgu','','','2024-09-30 09:41:35','2024-09-30 09:41:35','',0,'https://plusunmusic.com/?page_id=3',17,'page','',0);
